import react, {Component} from 'react';
import {Row} from 'reactstrap'
import { Tavolo } from './Tavolo';

class Gioco extends Component{
	render(){
		return(
			<Row><Tavolo /></Row>
		);
	}
}

export default TavoloGioco;
